  false,\n\t\"url\": null,\n\t\"notes\": \"The TIGER/Line shapefiles and related database
  files (.dbf) are an extract of selected geographic and cartographic information
  from then               U.S. Census Bureau's Master Address File / Topologically
  Integrated Geographic Encoding and Referencing (MAF/TIGER) Database (MTDB). The
  MTDB representsn               a seamless national file with no overlaps or gaps
  between parts, however, each TIGER/Line shapefile is designed to stand alone as
  an independent datan               set, or they can be combined to cover the entire
  nation. Combined New England City and Town Areas (CNECTAs) are defined by the Office
  of Management andn               Budget (OMB) and consist of two or more adjacent
  New England City and Town Areas (NECTAs) that have significant employment interchanges.
  The NECTAs thatn               combine to create a CNECTA retain separate identities
  within the larger combined statistical areas. Because CNECTAs represent groupings
  of NECTAs, theyn               should not be ranked or compared with individual
  NECTAs. The CBSAs for the 2010 Census are those defined by OMB and published in
  December 2009.n            \",\n\t\"license_title\": null,\n\t\"extras\": [{\n\t\t\"key\":
